import React from "react";
import './index.css';

const App = () => {

    const onSub =() => {
        console.log("Submitted");
    }
    return(
        <>
            <div className="containeer">
                <h1>Hello</h1>
                <form onSubmit={onSub}>
                <input type="text" placeholder="Enter your First Name  "/>
                <input type="text" placeholder="Enter your Last Name" />
                <button type="submit">Submit</button>
                </form>
            </div>
        </>
    )
}

export default App;
